export default () => (
  <board width="45mm" height="25mm" routingDisabled>
    <chip
      name="U1"
      footprint="qfn56_w7_h7_p0.4mm"
      pcbX={0}
      pcbY={0}
      connections={{
        pin1: "net.V3V3",
        pin2: "net.GND",
        pin10: "net.USB_DP",
        pin11: "net.USB_DM",
        pin20: "net.GPIO25",
      }}
    />

    <chip
      name="J1"
      footprint="pinrow4"
      pcbX={-16}
      pcbY={0}
      pcbRotation={90}
      connections={{
        pin1: "net.GND",
        pin2: "net.USB_DP",
        pin3: "net.USB_DM",
        pin4: "net.VBUS",
      }}
    />

    <chip
      name="J2"
      footprint="pinrow10"
      pcbX={14}
      pcbY={-7}
      pcbRotation={90}
      connections={{
        pin1: "net.V3V3",
        pin2: "net.GND",
        pin3: "net.GPIO25",
        pin4: "net.USB_DP",
        pin5: "net.USB_DM",
      }}
    />

    <chip
      name="J3"
      footprint="pinrow10"
      pcbX={14}
      pcbY={7}
      pcbRotation={90}
      connections={{
        pin1: "net.VBUS",
        pin2: "net.GND",
      }}
    />

    <resistor
      name="R1"
      resistance="1k"
      footprint="0402"
      pcbX={8}
      pcbY={8}
    />
    <led name="LED1" color="green" footprint="0603" pcbX={12} pcbY={8} />

    <trace from=".J1 > .pin1" to="net.GND" />
